def binary_rep(data):
    answer = ''

    for i in range(10):
        phi = data.const * data.F * data.F_degree * data.t_init * 2**(i)
        p_1 = (np.sin(phi/2))**2
        print(p_1)
        if round(p_1, 2) > 0.5:
            answer += '1'
        else:
            answer += '0'
    return answer


